import React from 'react';
import PageWrapper from '../components/PageWrapper';

export default function LunchMenu() {
	return (
		<PageWrapper>
			<div>
				<h3>WOK88</h3>
				<p>scoped!</p>
				<style jsx>{`
					p {
						color: blue;
					}
					div {
						background: goldenrod;
					}
					@media (max-width: 600px) {
						div {
							background: blue;
						}
					}
				`}</style>
				<style global jsx>{`
					body {
						background: #fffff0;
					}
				`}</style>
			</div>
		</PageWrapper>
	);
}
